	isVisible: (type,status) => {
		if(status == 'Future' && type == 'TRIP_BASED_INCENTIVE'){
			return true;
		}
		else{
			return false;
		}
	},
	callExpire: (current_row) => {
		storeValue("expired_campaign_row",current_row);
		showModal('expire_modal');
	},

}
